import React,{Button} from 'react'

const Admin = () => {
    return (
        <Container className="d-flex flex-column">
        <Button 
            variant={"outline-dark"}
            className="mt-4 p-2"
        >
            Добавить группу
        </Button>
        <Button 
            variant={"outline-dark"}
            className="mt-4 p-2"
        >
            Удалить статью
        </Button>
        <Button
            variant={"outline-dark"}
            className="mt-4 p-2"
        >
            Удалить пользователя
        </Button>
       </Container>
    );
};

export default Admin;
